import october from'../img/october/october.png'
import november from'../img/november/november.png'
import december from'../img/december/december.png'

export function January() {
  return (
    <Figure className='Figure'>
      <Figure.Image
        alt="171x180"
        src={january}
        
        />
      
    </Figure>
  );
}


